import classes from './Basket.module.css';

function Basket({ basket, bascketIsActive, toggleBascketIsActive }) {

  return (
    <div className={bascketIsActive ? classes.basket__wrapper + " " + classes.active : classes.basket__wrapper}>
      <svg role="presentation" class="t706__close-icon t706__sidebar-close-icon" width="23px" height="23px" viewBox="0 0 23 23" version="1.1" xmlns="http://www.w3.org/2000/svg"><g stroke="none" stroke-width="1" fill="#000" fill-rule="evenodd"><rect transform="translate(11.313708, 11.313708) rotate(-45.000000) translate(-11.313708, -11.313708) " x="10.3137085" y="-3.6862915" width="2" height="30"></rect><rect transform="translate(11.313708, 11.313708) rotate(-315.000000) translate(-11.313708, -11.313708) " x="10.3137085" y="-3.6862915" width="2" height="30"></rect></g></svg>
      <h1>Ваш заказ</h1>
    </div>
  );
}

export default Basket;
